import styled from 'styled-components'

export const Wrapper = styled.div`
  z-index: 900;
  flex-shrink: 0;
  position: sticky;
  top: 0;
  width: 100%;
  height: ${({ theme }) => theme.dimensions.navbarHeight};
  display: flex;
  justify-content: center;
  background-color: #ffffff;
  box-shadow: 0 1px 3px hsla(0, 0%, 0%, 0.2);
`
